import React from 'react'
import FeedItem from './feedItem'

let style = {
    overflow: 'scroll',
    height: '350px'
}

let unregistered = ''

setTimeout(() => {
    unregistered += '<FeedItem>abcdef</FeedItem>'
}, 3000)

const unregisteredFeed = () => {
    return(
    <div style={style}>
        <h1>Unregistered Activity</h1>
        {setTimeout(() => {
    unregistered += '<FeedItem>abcdef</FeedItem>'
}, 3000)}
    {unregistered}
    </div>)
}

export default unregisteredFeed
